import React, { Component } from "react";
import { TextField, Container, Button } from "@material-ui/core";

class Login extends Component {
  render() {
    return (
      <div>
        <h3>LOGIN</h3>
        <Container>
          <TextField style={{ width: 500 }} label="Email" variant="standard" />
          <br />
          <TextField
            style={{ width: 500 }}
            label="Passworld"
            margin="dense"
            variant="standard"
            type="password"
          />
          <br />
          <Button
            onClick={() => {
              console.log("AA");
            }}
            style={{
              width: 500,
              marginTop: 50,
              background: "yellow",
              color: "black"
            }}
          >
            LOGIN
          </Button>
        </Container>
      </div>
    );
  }
}

export default Login;
